function handleNode(context) {
  const row = JSON.parse(context.getParam("deployment"));
  const jenkins_uuid = context.getParam("jenkins_uuid");
  var repo =  context.getParam("repo");
  //   var commits = JSON.parse(context.getParam("commits"));
  const job_full_name =  repo;
  var date = new Date(row.deployable.created_on);
  var created_at = new Date(row.state.started_on);
  var updated_at = new Date(row.state.completed_on);

  var duration = updated_at.getTime() - created_at.getTime();

  // commits = !commits.message ? commits.map(item => item.sha) : [row.head_commit.id];
  var start_time = date.getTime();
  var payload = {};
  if (row.state && row.state.status && row.state.status.name) {
    payload = {
      job_name: repo,
      user_id: "SCMTrigger",
      job_run_params: [
        {
          type: "StringParameterValue",
          name: "version",
          value: row.version
        }
      ],
      repo_url: "https://bitbucket.org/aviosgroup/" + repo,
      start_time: start_time,
      result: row.state.status.name,
      duration: duration,
      build_number: row.number,
      jenkins_instance_guid: jenkins_uuid,
      jenkins_instance_name: "Jenkins Instance",
      jenkins_instance_url: "https://jenkins.dev.levelops.io/",
      job_run: null,
      job_full_name: job_full_name,
      job_normalized_full_name: job_full_name,
      branch_name: "deploy",
      module_name: null,
      scm_commit_ids: [row.deployable.commit && row.deployable.commit.hash? row.deployable.commit.hash: ""],
      trigger_chain: [{
        id: "SCMTrigger",
        type: "SCMTriggerCause"
      }]
    };
  }

  var hasPayload = Object.keys(payload).length > 0;

  // var strp = JSON.stringify(payload).replace(/"/g, '\\"');
  // levelops.serviceName().doSomething() - invoke a levelops service
  return { 
    state : "success",
    output : { 
      hasPayload : hasPayload,
      "cicd" : {
        request_type: "JenkinsPluginJobRunComplete",
        payload: JSON.stringify(payload)

      }
    } 
  };
}

